import React from "react";
import ReactDOM from "react-dom/client";
import { BrowserRouter } from "react-router-dom";
import { Amplify } from "aws-amplify";
import App from "./App";
import "./index.css";

// Configuration d'AWS Amplify - À remplacer par les valeurs réelles après le déploiement
Amplify.configure({
  Auth: {
    region: "eu-west-3", // Région AWS
    userPoolId: "VOTRE_USER_POOL_ID", // À remplacer après le déploiement
    userPoolWebClientId: "VOTRE_USER_POOL_CLIENT_ID", // À remplacer après le déploiement
  },
  API: {
    endpoints: [
      {
        name: "sportEquipmentApi",
        endpoint: "VOTRE_API_ENDPOINT", // À remplacer après le déploiement
        region: "eu-west-3", // Région AWS
      },
    ],
  },
  Storage: {
    AWSS3: {
      bucket: "VOTRE_BUCKET_NAME", // À remplacer après le déploiement
      region: "eu-west-3", // Région AWS
    },
  },
});

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <BrowserRouter>
      <App />
    </BrowserRouter>
  </React.StrictMode>
);
